import React from 'react';
import {Typography, Button} from '../../atoms';

const TitleWithLink = ({
  handleRedirectToPage, 
  link, 
  color, 
  content, 
  children,
}) => {
  return(
        <Button onClick={handleRedirectToPage(link)}>
          <Typography 
            family='sauceSans' 
            color={color} 
            size='xl' 
            transform='uppercase'
            align='initial'
          >
            {content}
            {children}
          </Typography>
        </Button>
    )
};

export default TitleWithLink;
